  "description": "This page explains more on the colorrange option, you can customize TreeSpider chart head colors to fit your taste by providing an array of colors to the colorrange option, by default, TreeSpider uses a range of rainbow colors, how does it work? TreeSpider interpolates the provided colors using d3.interpolateRgbBasis() which produces a color range based on the provided colors, it then slice out a color based on the index of the tree data of the chart head, the index gets converted into percentage, like for example if the index of the tree data is 98 and the total length of the tree data is 200, the maths is going to be 98/200 which then gives the percentage and with this percentage it is used to get a slice from the interpolated color range and then the tree data's chart head get assigned the color slice, next let's check out how it really works.",
